import React, { useState } from 'react';
import './App.css';
import TodoList from './TodoList';

function App() {
  const [todos, setTodos] = useState([{ id: 1, }])
  return (
    <>
    <TodoList todos={todos} />
    <input type="text" />
    <button> Add Todos</button>
    <button>Clear Completed Todos</button>
    <div>0 left to do</div>
    </>
  );
}

export default App;
